    // Puedes llamar a una función para generar la rutina y mostrarla en la página.
  };

  return (
    <div>
      <h2>Generador de Rutinas Diarias</h2>
      <form onSubmit={handleFormSubmit}>
        <label>
          Nombre:
          <input type="text" value={nombre} onChange={(e) => setNombre(e.target.value)} />
